import "react-big-calendar/lib/css/react-big-calendar.css";

export class CalendarPage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      eventsList: [],
      openEvent: false,
      event: ""
    };
  }

  componentDidMount() {
